import initalState from '../initalState'
import actionTypes from '../actionTypes'

export const wordFinishedReducer = (state = initalState.wordFinished, action) => {
    switch (action.type) {
        case actionTypes.UPDATE_WORD_FINISHED: {
            return action.bool;
        }
        default:
           return state
    }
}
